const initialState = {
    items: [
        {
            id: "1",
            brand: "ZARA",
            img: require('../../../assets/test/13.jpg'),
            color: "#000000",
            type: "Blazers",
            category: "Top"
        },
        {
            id: "2",
            brand: "ZARA",
            img: require('../../../assets/test/13.jpg'),
            color: "#000000",
            type: "Blazers",
            category: "Top"
        }
    ]
}

export const itemsReducer = (state = initialState, action) => {
    switch(action.type) {
        default: return state
    }
}
